import React, { Component } from "react";
import Card from "./Card";
export default class Cards extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [
        {
          name: "jiaxin",
          time: "aa",
          zoom: "afda",
          purpose: "pp",
        },
      ],
    };
  }

  render() {
    const cardsComponents = [];
    for (let i = 0; i < this.state.data.length; i++) {
      cardsComponents.push(<Card key={`card${i}`} />);
    }
    return (
      <div>
        <p>this is cards component</p>
        {cardsComponents}
      </div>
    );
  }
}
